-- Interesting Query 1: Top N Nutritionists
-- 1. View: Member_Changes
CREATE OR REPLACE VIEW Member_Changes AS
SELECT 
    mm_latest.Member_ID,
    (mm_latest.BMI - mm_first.BMI) AS BMI_Change,
    (mm_latest.Body_Fat_Percentage - mm_first.Body_Fat_Percentage) AS Body_Fat_Change,
    (mm_latest.Muscle_Mass - mm_first.Muscle_Mass) AS Muscle_Mass_Change,
    (mm_latest.Visceral_Fat_Level - mm_first.Visceral_Fat_Level) AS Visceral_Fat_Change
FROM 
    ieor215_project.MEMBER_MEASUREMENTS mm_latest
JOIN 
    (
        SELECT 
            mm1.Member_ID, 
            mm1.BMI, 
            mm1.Body_Fat_Percentage, 
            mm1.Muscle_Mass, 
            mm1.Visceral_Fat_Level
        FROM 
            ieor215_project.MEMBER_MEASUREMENTS mm1
        WHERE 
            mm1.Record_Date = (
                SELECT MIN(mm2.Record_Date) 
                FROM ieor215_project.MEMBER_MEASUREMENTS mm2 
                WHERE mm2.Member_ID = mm1.Member_ID
            )
    ) mm_first
    ON mm_latest.Member_ID = mm_first.Member_ID
WHERE 
    mm_latest.Record_Date = (
        SELECT MAX(mm3.Record_Date) 
        FROM ieor215_project.MEMBER_MEASUREMENTS mm3 
        WHERE mm3.Member_ID = mm_latest.Member_ID
    );

-- 2. View: Client_Health_Scores
CREATE OR REPLACE VIEW Client_Health_Scores AS
SELECT
    Member_ID,
    ((-1 * BMI_Change) 
     + (-1 * Body_Fat_Change)
     + (1 * Muscle_Mass_Change)
     + (-1 * Visceral_Fat_Change)) AS Health_Improvement_Score
FROM Member_Changes;

-- 3. View: Nutritionist_Performance
CREATE OR REPLACE VIEW Nutritionist_Performance AS
SELECT
    mcn.Employee_ID AS Nutritionist_ID,
    COUNT(DISTINCT CASE WHEN me.Membership_status = 'Active' THEN chs.Member_ID END) AS Active_Client_Count,
    COUNT(DISTINCT chs.Member_ID) AS Total_Client_Count,
    SUM(chs.Health_Improvement_Score) AS Total_Health_Improvement
FROM Client_Health_Scores chs
JOIN ieor215_project.Member_Consults_Nutritionist mcn 
    ON chs.Member_ID = mcn.Member_ID
JOIN ieor215_project.Member me 
    ON chs.Member_ID = me.Member_ID
GROUP BY mcn.Employee_ID;

-- 4. View: Avg_BMI_Trend
CREATE OR REPLACE VIEW Avg_BMI_Trend AS
SELECT 
    DATE(mm.Record_Date) AS Measurement_Date,
    AVG(mm.BMI) AS Avg_BMI
FROM ieor215_project.MEMBER_MEASUREMENTS mm
JOIN ieor215_project.Member me 
    ON mm.Member_ID = me.Member_ID
WHERE me.Membership_status = 'Active'
GROUP BY DATE(mm.Record_Date)
ORDER BY DATE(mm.Record_Date);


CREATE OR REPLACE VIEW Active_Member_BMI_Workout_View AS
SELECT
    M.Member_ID,
    AVG(MM.BMI) AS Average_BMI,
    (MAX(MM.BMI) - MIN(MM.BMI)) AS BMI_Change,
    COUNT(DISTINCT MPWS.Workout_ID) AS Workout_Session_Count,
    CASE 
        WHEN COUNT(DISTINCT MPWS.Workout_ID) = 0 THEN 0
        ELSE (MAX(MM.BMI) - MIN(MM.BMI)) / COUNT(DISTINCT MPWS.Workout_ID)
    END AS BMI_Change_Per_Session
FROM Member M
JOIN MEMBER_MEASUREMENTS MM ON M.Member_ID = MM.Member_ID
LEFT JOIN Member_Participates_Workout_Session MPWS ON M.Member_ID = MPWS.Member_ID
LEFT JOIN Workout_Session WS ON MPWS.Workout_ID = WS.Workout_ID
WHERE M.Membership_status = 'Active'
GROUP BY M.Member_ID;
